insert  into `web_config`(`id`,`sitename`,`sitedsp`,`keywords`,`logo`,`welcome`,`search`,`tag`,`meta`,`wxname`,`wxqr`,`agreement`,`bond`,`join`,`tel`,`icp`,`police`,`qq`,`kf`,`tongji`) values (1,'农产品商城-专业的农土特产网上购物商城','致力打造中国最大的农产品、生鲜专卖商城，打造乡村旅游电商平台，专业采购销售特产品、农产品、生鲜、肉禽等农','特产,土特产,农产品','/static/uploadfile/2016/1230/103951350_real.jpg','欢迎访问农产品商城！','农产品商城','采摘/农家乐/桃花','','1000','/static/uploadfile/2017/0221/154521473_real','“我买网”服务条款\r\n \r\n欢迎访问“我买网”！请在注册和接受我们服务前仔细阅读以下条款。您接受以下条款后方可接受“我买网”的服务。同时，“我买网”上张贴了“我买网”的相关政策，如付款方式、送货方式、验收政策、退换货政策、相应时段的促销政策等，这些内容构成了本《“我买网”服务条款》的一部分，也请您仔细阅读。为便利本服务条款叙述，以下也以“我们”代指“我买网”。\r\n \r\n一、服务基本前提\r\n \r\n我们的服务是通过互联网提供的，因此，您必须：\r\n \r\n（1）自行配备上网的所需设备，包括个人电脑、调制解调器或其它必备上网装置；\r\n（2）自行负担个人上网所支付的与此服务有关的网络费用及其他相关费用。\r\n \r\n同时，为了准确优质地向您提供服务，请确保：\r\n \r\n      （1）注册资料的真实、准确、详尽；\r\n      （2）注册信息如有变更，请及时更新。\r\n \r\n二、注册信息的保管和使用\r\n \r\n   您提供的注册信息，我们将按照法律和相关规定，采取技术和制度的手段为您妥善保管。除非获得您的授权或者按照法律及其程序要求进行透露外，我们将保证您个人信息的安全。\r\n \r\n   我们承诺仅根据“我买网”服务的目的使用您的个人信息。服务目的包括但不限于交易确认、客户回访、政策更新、发送促销信息等，除此之外，我们将对您的个人信息保密。如您认为我们超越了正常服务范畴使用了您的个人信息，请立即与客服中心联系，我们将核实纠正。\r\n \r\n三、政策发布和本服务条款变更\r\n \r\n如果我们发布新的服务政策，或者我们的服务政策或本服务条款有任何变更，我们将在“我买网”上以通知、公告或更改的方式进行，请您随时关注。\r\n \r\n四、账户和密码\r\n \r\n使用“我买网”过程中，您须保管好您的个人账户并对他人使用您的个人计算机作出限制。如果因为您个人管理不善造成账户（包括注册账户和密码、我买卡账户和密码等）被复制或被盗用出现的损失，应由您自己承担。同时，通过您的个人账户在”我买网”上发生的所有活动产生的责任，应由您承担。\r\n \r\n五、交易限制\r\n \r\n“我买网”的部分商品（如酒类）限制未成年人购买。如果我们发现以上情况，我们有权采取取消订单、冻结、关闭账户等措施。\r\n \r\n六、善意交易\r\n \r\n目前，“我买网”是一种B TO C （直接面向最终消费者）的商业模式，我们仅接受个人的消费订单，不接受商家（包括但不限于个人商户、经销商等）的订单，如有证据证明或者我们有理由相信订单来自商家（包括但不限于个人商户、经销商等），我们有权采取取消订单、冻结或关闭账户等措施，给我们造成损失的，我们保留追究责任的权利。\r\n \r\n原则上，一个人只允许在“我买网”拥有一个有效账户，如有证据证明或者我们有理由相信您存在恶意注册多个账户的情形，我们有权采取取消订单、冻结或关闭账户等措施，给我们造成损失的，我们保留追究责任的权利。\r\n \r\n如果您无正当理由多次拒收货物，则我们也有权取消您以后的订单。情形恶劣的，我们有权采取冻结、关闭账户的措施，并保留追究赔偿责任的权利。\r\n \r\n如我们发现您有其他违反本服务条款的行为，或者我们认为您存在恶意交易或不正常交易情形，我们有权采取取消订单、冻结或关闭账户等措施，给我们造成损失的，我们保留追究责任的权利。\r\n \r\n七、商品价格\r\n \r\n“我买网”上商品的价格存在随时变化的可能，最终成交价以订单被确认时的价格为准。如果在您点击“提交订单”按钮前我们的定价发生变化的，则价格以变化后的为准；如果在您点击“提交订单”按钮后我们的定价发生变化的，则价格以变化前的为准。但价格信息本身存在错误的除外。\r\n \r\n八、订单\r\n \r\n请在购买前仔细核实您所购买的产品的信息并提交订单，订单提交后系统将自动发送一封确认邮件。此后我们的工作人员将对您的订单进行审核并在通过审核后安排配送。\r\n \r\n“我买网”上的信息（包括但不限于价格、商品描述等），我们虽然尽力保证其准确，但也可能因人员操作或者系统问题产生错误，在此情况下我们将按正确的信息和您进行确认修改，您可以取消订单或者按照正确的信息与我们进行交易。给您带来的不便敬请谅解。\r\n \r\n如果您在一份订单里订购了多种商品并且我们只给您发出了其中一部分商品，那么请联系我们客服中心，我们将向您退还该部分款项或者向您补足剩余商品。\r\n \r\n当您（或代为签收人）签收了所购买的商品时，该商品的毁损和灭失风险即转移到您这一方。\r\n \r\n九、发货和收货\r\n \r\n送货范围已经张贴在“我买网”，请您仔细阅读并在每次下订单前再次进行确认，确保您提交的送货地址属于该范围之内，对于超出该范围的订购或配送要求，属于无效订单，我们有权拒绝。\r\n \r\n在提交订单前，请您再次确认您的配送地址，如果因为您地址填写失误造成货物重复配送，我们有权按照实际配送次数收取物流费用。\r\n \r\n收货人可以为您本人也可以为本人以外的其他人。我们将按照通过审核后的订单上所述的配送地址、收货人姓名和电话进行配送。如果收货人在配送过程中要求变更接收地址的，我们视同已经过您（即订货人）的同意。\r\n原则上收货人应当亲自接收，特殊情况（同时订单金额应在人民币2000元以下），收货人可以与客服中心联系申请由他人代为签收。如果您的配送地点属于办公区域，则前台人员代为签收视为已经经过您的同意。注：大额订单（大于等于人民币2000 元）我们有权要求收货人出示身份证。\r\n \r\n我们尽量将送货时间控制在1-3天，如遇不可抗力因素，包括但不限于以下四种情况：⑴自然灾害。如地震、台风、洪水、旱灾、海啸等。⑵政府行为。主要是指当事人在订立合同以后，政府当局颁布新政策、法律和行政措施而导致合同不能履行。⑶社会异常事件。如战争、罢工、骚乱、交通管制等。（4）恶劣天气所导致无法或难以正常送货。我们有权延迟送货时间。\r\n  \r\n十、网站评论及其他内容\r\n \r\n您可以在“我买网”上发布评论及其他内容，但是该评论及其他内容必须遵守相关法律法规，不可以发布包含色情、诽谤、威胁、侵犯隐私、侵犯知识产权、恶意中伤我们、病毒、反动宣传、商业广告或其他伤害第三方内容的信息。您也不可以使用虚假、冒充他人或其他方的信息注册“我买网”后发布评论或其他内容。以上您如有违反，我们有权编辑或删除以上内容，并保留追究您法律责任的权利。\r\n \r\n十一、知识产权\r\n \r\n“我买网”上的所有内容，如商标、文字、图片、标识、广告都是我们或者其内容提供者的排他性财产，您不可以未经授权擅自使用，同时，这些内容不可以被用于任何可能引起消费者对我们的服务引起混淆或者贬低的商品或者服务上。\r\n \r\n未经我们书面同意，您不可以用任何方式对“我买网”网站内容进行修改，也不可复制、下载“我买网”网页内容、数据、信息进行转售或商业利用。经我们书面同意，您将被授予有限的、可撤销的和非独家的权利建立连接到“我买网”主页的超链接，但这个链接不能以虚假、误导、贬低或其他方式侵害我们的商品和服务。\r\n \r\n十二、  适用性及责任限制\r\n \r\n除非法律规定或者“我买网”上明文承诺，我们将不对我们提供的商品的适用性或满足您特定需求和目的进行任何明示或者默示的担保。请在购买前确认好您的需求，同时仔细阅读商品说明。\r\n \r\n如果因为不可以抗力、您或我们的计算机系统故障或者遭受黑客攻击造成的交易无法完成或者损失，我们不承担责任。\r\n \r\n 十三、   关于跨境购的说明\r\n \r\n根据海关总署的相关规定，跨境购订单必须以合理自用为原则，并且需核实收件人真实信息，请您提供身份证号码进行入境申报；跨境购商品属于境外购买行为 ，因此无法为您提供发票；跨境购产品符合海外质量标准,与中国标准可能有所差异;因发货流程特殊性，订单支付完成后，若产品无质量问题，不支持七天无理由退换货，不支持修改和取消订单。\r\n \r\n十四、   其他\r\n \r\n本服务条款的订立、执行、解释及争议解决均适用中华人民共和国法律（不包括香港、澳门、台湾地区）。本服务条款具有可分性，部分无效不影响其它部分效力。\r\n \r\n如果您是我们的注册用户，本服务条款将对您持续有效，有效期至您注销或者被关闭账户后，但知识产权相关条款在此后继续有效。\r\n \r\n您和我们如有争议，应先友好协商解决，协商不成，应提交北京仲裁委员会仲裁。\r\n \r\n \r\n \r\n联系我们：\r\n \r\n客服电话：400-005-5678（仅收市话费）\r\n工作时间：周一至周日9:00-18:00 \r\n地址：北京市建国门内大街8号中粮广场\r\n邮编：100005\r\n团购电话：010-85001837\r\n客服邮箱：service@womai.com\r\n投诉邮箱：tousu@womai.com\r\n(您可在邮件中注明您的我买网注册账户或需要查询的订单号，以便我买网为您提供更好的服务)','1000.00',1,'400-000-7192','沪ICP备09008015号','京公网安备 11010502022386号','3487568347','','');

