/*Table structure for table `web_shop_goods` */

DROP TABLE IF EXISTS `web_shop_goods`;

CREATE TABLE `web_shop_goods` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'pk',
  `userid` int(11) NOT NULL COMMENT '对应的商家id',
  `catid` int(11) NOT NULL COMMENT '商品类型',
  `shop_catid` int(11) NOT NULL COMMENT '商铺自定义分类',
  `title` varchar(150) COLLATE utf8_bin NOT NULL COMMENT '产品标题',
  `subtitle` varchar(200) COLLATE utf8_bin NOT NULL,
  `content` text COLLATE utf8_bin NOT NULL COMMENT '对应extra表中id',
  `thumb` varchar(80) COLLATE utf8_bin NOT NULL COMMENT '商品缩略图',
  `oldprice` decimal(10,2) NOT NULL,
  `price` decimal(10,2) NOT NULL COMMENT '单价',
  `weight` decimal(10,2) NOT NULL COMMENT '商品重量',
  `ms` decimal(10,2) DEFAULT NULL COMMENT '体积',
  `goods_sn` varchar(50) COLLATE utf8_bin NOT NULL,
  `trans_type` int(11) NOT NULL DEFAULT '1' COMMENT '运费计算方式：1按重量；2按件数',
  `spec` varchar(2000) COLLATE utf8_bin NOT NULL,
  `num` int(11) NOT NULL DEFAULT '1' COMMENT '货品数目，库存',
  `env` int(11) NOT NULL COMMENT '环保等级',
  `view` int(11) NOT NULL DEFAULT '0',
  `tj` int(11) NOT NULL DEFAULT '0',
  `hot` int(11) NOT NULL DEFAULT '0' COMMENT '热卖：0未设置；1已设置',
  `fav` int(11) NOT NULL DEFAULT '0',
  `buy` int(11) NOT NULL DEFAULT '0' COMMENT '购买数目',
  `pj` int(11) NOT NULL DEFAULT '0' COMMENT '评价数目',
  `sort` mediumint(9) NOT NULL DEFAULT '1' COMMENT '排序字段',
  `addtime` int(11) NOT NULL COMMENT '添加时间',
  `updatetime` int(11) NOT NULL COMMENT '更新时间',
  `status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '商品状态,0：未审核，1：已审核，4下架',
  `isdel` int(11) NOT NULL DEFAULT '0',
  `cash` decimal(10,2) DEFAULT NULL COMMENT '返现金额',
  `flvid` int(11) DEFAULT NULL COMMENT '运费模板',
  `is_fx` int(11) NOT NULL DEFAULT '0' COMMENT '是否是可分销的商品：0不是；1是',
  `fx_fee` decimal(10,2) NOT NULL COMMENT '分销佣金',
  PRIMARY KEY (`id`),
  KEY `price` (`price`)
) ENGINE=MyISAM AUTO_INCREMENT=12 DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='商铺产品主表';

/*Data for the table `web_shop_goods` */

insert  into `web_shop_goods`(`id`,`userid`,`catid`,`shop_catid`,`title`,`subtitle`,`content`,`thumb`,`oldprice`,`price`,`weight`,`ms`,`goods_sn`,`trans_type`,`spec`,`num`,`env`,`view`,`tj`,`hot`,`fav`,`buy`,`pj`,`sort`,`addtime`,`updatetime`,`status`,`isdel`,`cash`,`flvid`,`is_fx`,`fx_fee`) values (4,122,49,2,'本来散养土鸡卵(鸡蛋)20枚','自然散养 本来鲜香 蛋黄更大','<div class=\"tal\" style=\"margin-left:0.1rem;\">\r\n	<p style=\"font-family:\'Microsoft YaHei\';font-size:22px;color:#FF8C00;\">\r\n		本来散养土鸡卵\r\n	</p>\r\n<br />\r\n</div>\r\n<img src=\"https://image.benlailife.com/ProductNewDetailImage/P0000278969TC/65ba954a-b31f-4370-90e3-1c2e4e961124.jpg?imageView2/2/format/webp\" /> \r\n<div class=\"tal\" style=\"margin-left:0.1rem;\">\r\n	<p style=\"font-family:\'Microsoft YaHei\';font-size:22px;color:#FF8C00;\">\r\n		林间放养\r\n	</p>\r\n<span style=\"font-size:14px;line-height:24px;font-family:\'Microsoft YaHei\';\">一片简单的小树林<br />\r\n一群悠闲的漫步者<br />\r\n在远离市区的林间农场<br />\r\n清新的空气<br />\r\n清泉饮水……<br />\r\n一切简单而又不简单</span><br />\r\n</div>\r\n<img src=\"https://img3.benlailife.com/ProductNewDetailImage/P0000278969TC/aa83d373-0ad1-45ce-bb6b-cc15d2e86d91.jpg?imageView2/2/format/webp\" /> \r\n<div class=\"tal\" style=\"margin-left:0.1rem;\">\r\n	<span style=\"font-size:14px;line-height:24px;font-family:\'Microsoft YaHei\';\">在这林间<br />\r\n虫子、树叶、嫩草、小石子儿<br />\r\n都是这群生产者所钟爱的食物<br />\r\n配上自家的玉米、蔬菜、豆粕<br />\r\n不用任何外购的调配饲料</span><br />\r\n<span style=\"font-size:14px;line-height:24px;font-family:\'Microsoft YaHei\';\">让它们健康地生长</span><br />\r\n</div>\r\n<div class=\"tal\" style=\"margin-left:0.1rem;\">\r\n	<p style=\"font-family:\'Microsoft YaHei\';font-size:22px;color:#FF8C00;\">\r\n		还原鸡蛋本来味道\r\n	</p>\r\n</div>\r\n<img src=\"https://image3.benlailife.com/ProductNewDetailImage/P0000278969TC/2a5f2475-27b6-4d7d-8322-6f206a519ab0.jpg?imageView2/2/format/webp\" /> \r\n<div class=\"tal\" style=\"margin-left:0.1rem;\">\r\n	<span style=\"font-size:14px;line-height:24px;font-family:\'Microsoft YaHei\';\">当鸡群自然生长成熟后<br />\r\n便要开始产蛋<br />\r\n自然健康的鸡妈妈<br />\r\n产下的蛋虽然个头不大<br />\r\n但却充满了自然的气息</span><br />\r\n</div>\r\n<img src=\"https://image4.benlailife.com/ProductNewDetailImage/P0000278969TC/e1aec621-0f14-4f6b-937f-ed8a9c6181d1.jpg?imageView2/2/format/webp\" /> \r\n<div class=\"tal\" style=\"margin-left:0.1rem;\">\r\n	<span style=\"font-size:14px;line-height:24px;font-family:\'Microsoft YaHei\';\">一只优秀的土鸡蛋<br />\r\n蛋清要清澈而黏稠<br />\r\n蛋黄比一般的鸡蛋更大<br />\r\n色泽亮丽金黄<br />\r\n口感也更加的圆滑<br />\r\n透着自然的鲜香，无腥味<br />\r\n纯纯的天然蛋，<br />\r\n即使是简单的水煮<br />\r\n也是本真的美味&nbsp;</span><br />\r\n</div>\r\n<a name=\"sublist03\"></a><img width=\"980\" height=\"30\" src=\"https://image1.benlailife.com/webStatic/images/n_detail/detailsp_tit04_c07920fd.png?imageView2/2/format/webp\" /> \r\n<div class=\"detl_pic\">\r\n	<img src=\"https://image7.benlailife.com/ProductNewDetailImage/P0000278969TC/68aab514-9f30-4e1c-ae70-e77e81eadef9.jpg?imageView2/2/format/webp\" /> \r\n	<div class=\"tal\" style=\"margin-left:0.1rem;\">\r\n		<p style=\"font-family:\'Microsoft YaHei\';font-size:22px;color:#FF8C00;\">\r\n			家常鸡蛋羹\r\n		</p>\r\n<span style=\"font-size:14px;line-height:24px;font-family:\'Microsoft YaHei\';\">1、将鸡蛋打散，放入适当的食盐搅匀<br />\r\n2、兑入凉开水继续搅拌（蛋液：水约为1:1.5），滤去浮沫与蛋筋，盖上保鲜膜<br />\r\n3、锅中水烧开，隔水用中大火蒸15分钟左右，虚火焖3分钟<br />\r\n4、去保鲜膜，根据口味放入调料&nbsp;</span><br />\r\n	</div>\r\n	<div class=\"tal\" style=\"margin-left:0.1rem;\">\r\n		<p style=\"font-family:\'Microsoft YaHei\';font-size:22px;color:#FF8C00;\">\r\n			鸡蛋保存tips：\r\n		</p>\r\n<span style=\"font-size:14px;line-height:24px;font-family:\'Microsoft YaHei\';\">1.鸡蛋不可用水清洗，清洗鸡蛋会破坏其原有的外蛋壳膜，使得细菌与微生物入侵；<br />\r\n2.放冰箱冷藏，小头朝下；<br />\r\n3.不与挥发性，有强烈性气味的食品放一起，如葱，姜，辣椒，酒等；<br />\r\n4.从冰箱取出后尽快食用切勿再次冷藏，因室温鸡蛋“发汗”，小水滴中的细菌和微生物透过蛋壳深入蛋液内层加速鸡蛋的变质。&nbsp;</span> \r\n	</div>\r\n</div>','/static/uploadfile/2016/0903/105924436_real.jpg','32.80','0.01','10.00','0.00','43534534',0,'a:3:{i:0;a:2:{s:8:\"specname\";s:6:\"称重\";s:7:\"specval\";s:9:\"不称重\";}i:1;a:2:{s:8:\"specname\";s:9:\"保质期\";s:7:\"specval\";s:5:\"30天\";}i:2;a:2:{s:8:\"specname\";s:6:\"包装\";s:7:\"specval\";s:3:\"无\";}}',2211,0,97,1,0,0,1,0,0,1472871590,1488073383,1,0,NULL,4,1,'0.01'),(5,122,46,0,'大象牙芒果1粒装约500g','果肉坚实细腻，浓香清甜，外形似象牙而得名。','<div class=\"box980\" style=\"color:#333333;font-family:宋体, \'Arial Narrow\', HELVETICA;\">\r\n	<div class=\"good15_all\" style=\"margin:20px 0px;\">\r\n		<ul style=\"vertical-align:bottom;\">\r\n			<li style=\"color:#4C4C4C;vertical-align:bottom;\">\r\n				品名： 大象牙芒果1粒装约500g\r\n			</li>\r\n			<li style=\"color:#4C4C4C;vertical-align:bottom;\">\r\n				规格： 1粒/约500g\r\n			</li>\r\n			<li style=\"color:#4C4C4C;vertical-align:bottom;\">\r\n				温馨提示： 忌放冰箱存储 芒果在常温环境下存储即可，不要放入冰箱，否则会加速变黑腐烂，同时注意避免口舌接触芒果表皮，有可能会引起过敏哦。\r\n			</li>\r\n			<li style=\"color:#4C4C4C;vertical-align:bottom;\">\r\n				产地： 海南\r\n			</li>\r\n		</ul>\r\n		<ol>\r\n			<li style=\"vertical-align:bottom;\">\r\n				<img src=\"https://image.benlailife.com/ProductImages/000/000/027/348/medium/56eb4a4b-84b5-47e3-b7c6-708e192c31f8.jpg?imageView2/2/format/webp\" style=\"width:280px;height:280px;\" /> \r\n			</li>\r\n		</ol>\r\n<a name=\"sublist01\"></a><img width=\"980\" height=\"30\" src=\"https://image3.benlailife.com/webStatic/images/n_detail/detailsp_tit02_e7777608.gif?imageView2/2/format/webp\" /><img src=\"https://image7.benlailife.com/ProductNewDetailImage/0102021620C/02p.jpg?imageView2/2/format/webp\" /> \r\n		<div class=\"tal\">\r\n			&nbsp;&nbsp;\r\n		</div>\r\n<img src=\"https://image4.benlailife.com/ProductNewDetailImage/0102021620C/838.jpg?imageView2/2/format/webp\" /> \r\n		<div class=\"tal\">\r\n			&nbsp;\r\n		</div>\r\n<a name=\"sublist05\"></a><img width=\"980\" height=\"30\" src=\"https://image4.benlailife.com/webStatic/images/n_detail/detailsp_tit06_c7ad2f0a.png?imageView2/2/format/webp\" /> \r\n		<div class=\"detl_com\">\r\n			<p>\r\n				<img src=\"https://image4.benlailife.com/webStatic/images/detailsp/detailsp_service_01_c4082bb4.jpg?imageView2/2/format/webp\" /><img src=\"https://image.b